const Header = (props) => {
  console.log(props)
  return (
    <h1>{props.course}</h1>
  )
}

const Content = (props) => {
  console.log(props)
  return (
    <div>
      <Part part = {props[0]} excersizes = {props.excersizes} />
      <Part part = {props[1]} excersizes = {props.excersizes} />
      <Part part = {props[2]} excersizes = {props.excersizes} />
    </div>
  )
}

const Part = (props) => {
  console.log(props)
  return (
    <p>
        {props.part} {props.excersizes}
    </p>
  )
}

const Total = (props) => {
  console.log(props)
  return (
    <p> Number of excersizes {props.one+props.two+props.three} </p>
  )
}


const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const excersizes1 = 10 
  const part2 = 'Using props to pass data'
  const excersizes2 = 7
  const part3 = 'State of a component'
  const excersizes3 = 14
  const parts = [ 'Fundamentals of React', 'Using props to pass data', 'State of a component' ]
  const excersize_num = [10, 7, 14]
  return (
    <div>
      <Header course = {course}/>
      <Content part = {parts} excersizes = {excercizes_num} />
      <Total one = {excersizes1} two = {excersizes2} three = {excersizes3} />
    </div>
  );
}

export default App;
